import 'react-native-gesture-handler';
import { StatusBar } from 'expo-status-bar';
import React, {useEffect} from 'react';
import { SafeAreaProvider } from 'react-native-safe-area-context';

import {Auth, API, graphqlOperation} from 'aws-amplify'

import { withAuthenticator } from 'aws-amplify-react-native'

import {getUser, listUsers} from './src/graphql/queries'
import {createUser} from './src/graphql/mutations'
import Amplify from 'aws-amplify'
import config from './src/aws-exports'
Amplify.configure(config)

import useCachedResources from './hooks/useCachedResources';
import useColorScheme from './hooks/useColorScheme';
import Navigation from './navigation';

 function App() {
  const isLoadingComplete = useCachedResources();
  const colorScheme = useColorScheme();
  const randomImages = [
   'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRva7OrwBcAFa0GYbDDpKta67pSjJRLumJs2Z-Pk_vg5Jobz1EQXL-tkqMdV4dF4GYKPwE&usqp=CAU',
    'data:image/jpeg;base64,'
   ,
   'data:image/jpeg;base64,',
   ,'data:image/jpeg;base64,' 
  ]
  const getRandomImages = () => {
    const randomImage =  randomImages[Math.floor(Math.random() * randomImages.length)]
    return randomImage
  }
  useEffect(() => {
  const fetchData = async () => {
  const userInfo = await Auth.currentAuthenticatedUser({ bypassCache: false})
  if (userInfo) {
    //get the user from the backend
    const userData = await API.graphql(
      graphqlOperation(
        getUser,
        {id: userInfo.attributes.sub} 
       ))

       if (userData.data.getUser) {
         console.log('user is already registered')
         return
       }

       const newUser = {
         id: userInfo.attributes.sub,
         name: userInfo.username,
         imageUrl: getRandomImages(),
         status: 'Hey, i am using whatsapp'
       }

       await API.graphql(graphqlOperation(
         createUser,
         {input: newUser}
       ))
  }
}
  fetchData()
  }, [])

  if (!isLoadingComplete) {
    return null;
  } else {
    return (
      <SafeAreaProvider>
        <Navigation colorScheme={colorScheme} />
        <StatusBar />
      </SafeAreaProvider>
    );
  }
}

export default withAuthenticator(App)